import React from "react";
import"./style.css"; 

function Header() {
    return(
            <header className="testeHeader">
                <h1>Header</h1>
                <header>
                <div class="center">
                    <div class="logo"><img src="Assets/Logo_transparencia.png" /></div>
                    <div class="menu">
                        <a href="#">Home</a>
                        <a href="#">Destinos</a>
                        <a href="#">Promoções</a>
                        <a href="#">Contato</a>
                    </div>
                </div>
            </header>
            </header>
    )
}

export default Header;
